  `encryption` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `status_id` int(10) unsigned NOT NULL DEFAULT '10',
  `allow_insecure_connection` tinyint(1) NOT NULL DEFAULT '0',
  `accesscontrollist_id` int(10) unsigned NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `appemailaccount_status_id_foreign` (`status_id`),
  KEY `appemailaccount_accesscontrollist_id_foreign` (`accesscontrollist_id`),
  CONSTRAINT `appemailaccount_accesscontrollist_id_foreign` FOREIGN KEY (`accesscontrollist_id`) REFERENCES `appaccesscontrollist` (`id`) ON UPDATE CASCADE,
