/*!40000 ALTER TABLE `appemailtemplate` DISABLE KEYS */;
INSERT INTO `appemailtemplate` VALUES (1,'PO Template','New Purchase Order','Order: {{{purchase_order.number}}}\n Date: {{{current_date.full_date}}}\n Ship To: {{{purchase_order.ship_to_name}}}\n\n Here is our order.\n Please contact us with any shipping information.\n\n Thank you and have a nice day!\n {{{current_user.first_name}}} {{{current_user.last_name}}}','2018-07-24 03:37:21','2018-07-24 03:37:21'),(2,'SO Template','Your order is being processed','{{{sales_order.bill_to_name}}} -\n\n Thank you for your order. Your order number is SO # {{{sales_order.number}}}.\n You will receive another e-mail once your order has shipped.\n\n Thank you for your business.\n {{{current_user.first_name}}} {{{current_user.last_name}}}','2018-07-24 03:37:21','2018-07-24 03:37:21'),(3,'Ship Template','Your order has shipped','@BILLTONAME -\n\n Your order, SO # @ORDERNUM has shipped.\n If you have any questions, please give us a  call.\n\n Thank you and have a nice day!\n {{{current_user.first_name}}} {{{current_user.last_name}}}','2018-07-24 03:37:21','2018-07-24 03:37:21');
