,'Advanced Barcoding Features','When enabled locations can have alternate barcode names and additional report related barcoding options are revealed on the parts.',2,NULL,'0','0',28,'2018-07-24 03:40:20','2018-07-24 03:40:20'),(106,0,'Auto-Commit Build to Order Outputs','When enabled any workorder linked with an order will automatically commit the output goods to their respective pick lines upon completion.',2,NULL,'0','0',28,'2018-07-24 03:40:22','2018-07-24 03:40:22'),(107,0,'Use Simulated Pick Qty','This setting enables the simulated pick qty feature which continuously computes the ideal sequence of fulfillment for orders based on available inventory and order age/priority.',2,NULL,'0','0',28,'2018-07-24 03:40:25','2018-07-24 03:40:25'),(108,0,'Auto-Issue Sales Order On Quote Win','When enabled the resulting sales order from winning a quote will automatically be issued, if the user has permission to issue sales orders.',2,NULL,'1','1',28,'2018-07-24 03:40:29','2018-07-24 03:40:29'),(109,0,'Default Shipping Part','The default shipping part to use for pass through shipping charges.',3,11,'','',2,'2018-07-24 03:40:39','2018-07-24 03:40:39'),(110,0,'Auto-Credit Customer Payment Balance Upon Order Completion','When enabled a credit type payment will be created automatically when a sales order is completed and there is unused payment remaining due to closed short or voided lines.',2,NULL,'1','1',28,'2018-07-24 03:40:43','2018-07-24 03:40:43'),(111,0,'Max Rounding Error Correction','This is the maximum dollar figure that a rounding correction can be up to. Typically these are only a few pennies, however, with many discounts and pricing rules coupled with high volume it would not be unreasonable for there to be $0.20 or so of rounding correction required.',8,NULL,'0.10','0.10',28,'2018-07-24 03:41:07','2018-07-24 03:41:07'),(112,0,'Require Permission to Issue Unfulfillable Sales Orders','When enabled a new permission is revealed \"Issue Unfulfillable Sales Orders\" which is required to issue a sales order that is short on inventory.',2,NULL,'0','0',28,'2018-07-24 03:41:13','2018-07-24 03:41:13'),(113,0,'Auto-Issue Build to Order WOs Linked with SOs','When enabled any work order associated with a sales order will be automatically issued.',2,NULL,'1','1',28,'2018-07-24 03:41:18','2018-07-24 03:41:18'),(114,0,'Restrict Viewing of Picks to Assigned Users','Limits access to picks to those who they are assigned or have permission to view.',2,NULL,'0','0',28,'2018-07-24 03:41:14','2018-07-24 03:41:14'),(115,0,'Pass Through Shipping Cost By Default','Pass through the shipping cost on sales order by default.',2,NULL,'0','0',28,'2018-07-24 03:41:22','2018-07-24 03:41:22'),(116,0,'Include Company Phone in Report Header','Displays the phone number recorded on the company settings in report headers.',2,NULL,'0','0',28,'2018-07-24 03:41:22','2018-07-24 03:41:22'),(117,0,'Include Company Email in Report Header','Displays the email address recorded on the company settings in report headers.',2,NULL,'0','0',28,'2018-07-24 03:41:22','2018-07-24 03:41:22'),(118,0,'Default Sales Order Fulfillment Plan','This fulfillment plan will be used for sales orders if not otherwise specified.',3,13,'213','213',28,'2018-07-24 03:41:27','2018-07-24 03:41:27'),(119,0,'Asynchronous Report Cutoff','The amount of time in seconds to wait for a report to finish before leaving it to complete in the background. A zero value disables the feature.',5,NULL,'30','30',28,'2018-07-24 03:41:33','2018-07-24 03:41:33'),(120,0,'Purchase in Multi-Currency','This setting enables the creation of purchase related documents using foreign currency.',2,NULL,'0','0',28,'2018-07-24 03:41:38','2018-07-24 03:41:38'),(121,0,'Fiscal Year Start Date','The month and day will be used as the start of the fiscal year resetting PNL account balances on the date each year.',4,NULL,'2017-01-01T00:00:00+00:00','2017-01-01T00:00:00+00:00',28,'2018-07-24 03:41:48','2018-07-24 03:41:48'),(122,0,'Quote Expires After X Days','The number of days from current at which point the quote should be set to expire.',5,NULL,'','',28,'2018-07-24 03:41:49','2018-07-24 03:41:49'),(123,0,'Job Number Format','The format for auto-generated job numbers.',1,NULL,'######','######',28,'2018-07-24 03:41:52','2018-07-24 03:41:52'),(124,0,'Job Number Last Used','The last auto-generated job number used.',1,NULL,'','',28,'2018-07-24 03:41:52','2018-07-24 03:41:52'),(125,0,'Forecasting Time Interval','The default time interval over which data samples will be collected for forecasting purposes.',3,14,'215','215',28,'2018-07-24 03:42:10','2018-07-24 03:42:10'),(126,0,'Return Weight Padding Percentage','This setting determines the percentage by which calculated return weights should be boosted to pad for packaging weight (e.g. 10 would be the weight of the items plus 10%)',5,NULL,'0','0',28,'2018-07-24 03:42:06','2018-07-24 03:42:06'),(127,0,'Auto-Group Picklines','When enabled LOCATE will combine untracked, same part picklines into a single pickline.',2,NULL,'0','0',28,'2018-07-24 03:42:13','2018-07-24 03:42:13'),(128,0,'Use Quote Number as Customer PO Number When Blank','When enabled LOCATE will Set the Customer PO Number as the Quote Number if it is not already set',2,NULL,'1','1\n',28,'2018-08-10 04:50:36','2018-08-10 05:45:17');
