CREATE TABLE `appship` (
  `id` int(10) unsigned NOT NULL,
  `number` varchar(15) COLLATE utf8_unicode_ci NOT NULL,
  `bol_number` varchar(17) COLLATE utf8_unicode_ci DEFAULT NULL,
  `site_id` int(10) unsigned NOT NULL,
  `location_id` int(10) unsigned NOT NULL,
  `destination_address_id` int(10) unsigned NOT NULL,
  `destination_site_id` int(10) unsigned DEFAULT NULL,
  `account_id` int(10) unsigned DEFAULT NULL,
  `status_id` int(10) unsigned NOT NULL DEFAULT '6',
  `assigned_user_id` int(10) unsigned DEFAULT NULL,
  `shipping_salesorderline_id` int(10) unsigned DEFAULT NULL,
  `accesscontrollist_id` int(10) unsigned NOT NULL,
  `completed_at` datetime DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  PRIMARY KEY (`id`),
  KEY `appship_site_id_foreign` (`site_id`),
  KEY `appship_destination_address_id_foreign` (`destination_address_id`),
  KEY `appship_destination_site_id_foreign` (`destination_site_id`),
  KEY `appship_location_id_foreign` (`location_id`),
  KEY `appship_account_id_foreign` (`account_id`),
  KEY `appship_status_id_foreign` (`status_id`),
  KEY `appship_assigned_user_id_foreign` (`assigned_user_id`),
  KEY `appship_accesscontrollist_id_foreign` (`accesscontrollist_id`),
  KEY `appship_number_index` (`number`),
  KEY `appship_shipping_salesorderline_id_foreign` (`shipping_salesorderline_id`),
  CONSTRAINT `appship_accesscontrollist_id_foreign` FOREIGN KEY (`accesscontrollist_id`) REFERENCES `appaccesscontrollist` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `appship_account_id_foreign` FOREIGN KEY (`account_id`) REFERENCES `appaccount` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `appship_assigned_user_id_foreign` FOREIGN KEY (`assigned_user_id`) REFERENCES `appuser` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `appship_destination_address_id_foreign` FOREIGN KEY (`destination_address_id`) REFERENCES `appaddress` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `appship_destination_site_id_foreign` FOREIGN KEY (`destination_site_id`) REFERENCES `appsite` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `appship_id_foreign` FOREIGN KEY (`id`) REFERENCES `apptransaction` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `appship_location_id_foreign` FOREIGN KEY (`location_id`) REFERENCES `applocation` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `appship_shipping_salesorderline_id_foreign` FOREIGN KEY (`shipping_salesorderline_id`) REFERENCES `cfgsalesorderline` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `appship_site_id_foreign` FOREIGN KEY (`site_id`) REFERENCES `appsite` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `appship_status_id_foreign` FOREIGN KEY (`status_id`) REFERENCES `msstatus` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
