CREATE TABLE `appvendor` (
  `id` int(10) unsigned NOT NULL,
  `number` varchar(20) COLLATE utf8_unicode_ci NOT NULL,
  `name` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `url` text COLLATE utf8_unicode_ci,
  `status_id` int(10) unsigned DEFAULT NULL,
  `carrier_id` int(10) unsigned DEFAULT NULL,
  `carrierservicelevel_id` int(10) unsigned DEFAULT NULL,
  `lead_time` tinyint(3) unsigned DEFAULT NULL,
  `leadtime_uom_id` int(10) unsigned DEFAULT NULL,
  `credit_limit` decimal(20,10) DEFAULT NULL,
  `balance` decimal(20,10) DEFAULT NULL,
  `min_order_amount` decimal(20,10) DEFAULT NULL,
  `currency_id` int(10) unsigned DEFAULT NULL,
  `account_number` varchar(40) COLLATE utf8_unicode_ci DEFAULT NULL,
  `alert_note` text COLLATE utf8_unicode_ci,
  `default_address_id` int(10) unsigned DEFAULT NULL,
  `default_phone_id` int(10) unsigned DEFAULT NULL,
  `default_email_id` int(10) unsigned DEFAULT NULL,
  `fobpoint_id` int(10) unsigned DEFAULT NULL,
  `paymentterm_id` int(10) unsigned DEFAULT NULL,
  `shippingterm_id` int(10) unsigned DEFAULT NULL,
  `default_logo_document_id` int(10) unsigned DEFAULT NULL,
  `accesscontrollist_id` int(10) unsigned NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `updated_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  `deleted_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `appvendor_deleted_at_index` (`deleted_at`),
  KEY `appvendor_status_id_foreign` (`status_id`),
  KEY `appvendor_carrier_id_foreign` (`carrier_id`),
  KEY `appvendor_leadtime_uom_id_foreign` (`leadtime_uom_id`),
  KEY `appvendor_currency_id_foreign` (`currency_id`),
  KEY `appvendor_fobpoint_id_foreign` (`fobpoint_id`),
  KEY `appvendor_paymentterm_id_foreign` (`paymentterm_id`),
  KEY `appvendor_shippingterm_id_foreign` (`shippingterm_id`),
  KEY `appvendor_accesscontrollist_id_foreign` (`accesscontrollist_id`),
  KEY `appvendor_number_index` (`number`),
  KEY `appvendor_name_index` (`name`),
  KEY `appvendor_carrierservicelevel_id_foreign` (`carrierservicelevel_id`),
  KEY `appvendor_default_logo_document_id_foreign` (`default_logo_document_id`),
  KEY `appvendor_default_address_id_foreign` (`default_address_id`),
  KEY `appvendor_default_email_id_foreign` (`default_email_id`),
  KEY `appvendor_default_phone_id_foreign` (`default_phone_id`),
  CONSTRAINT `appvendor_accesscontrollist_id_foreign` FOREIGN KEY (`accesscontrollist_id`) REFERENCES `appaccesscontrollist` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `appvendor_carrier_id_foreign` FOREIGN KEY (`carrier_id`) REFERENCES `appcarrier` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `appvendor_carrierservicelevel_id_foreign` FOREIGN KEY (`carrierservicelevel_id`) REFERENCES `cfgcarrierservicelevel` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `appvendor_currency_id_foreign` FOREIGN KEY (`currency_id`) REFERENCES `appcurrency` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `appvendor_default_address_id_foreign` FOREIGN KEY (`default_address_id`) REFERENCES `cfgaccountaddress` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `appvendor_default_email_id_foreign` FOREIGN KEY (`default_email_id`) REFERENCES `cfgaccountemail` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `appvendor_default_logo_document_id_foreign` FOREIGN KEY (`default_logo_document_id`) REFERENCES `appdocument` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `appvendor_default_phone_id_foreign` FOREIGN KEY (`default_phone_id`) REFERENCES `cfgaccountphone` (`id`) ON DELETE SET NULL ON UPDATE CASCADE,
  CONSTRAINT `appvendor_fobpoint_id_foreign` FOREIGN KEY (`fobpoint_id`) REFERENCES `appfobpoint` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `appvendor_id_foreign` FOREIGN KEY (`id`) REFERENCES `appaccount` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `appvendor_leadtime_uom_id_foreign` FOREIGN KEY (`leadtime_uom_id`) REFERENCES `appuom` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `appvendor_paymentterm_id_foreign` FOREIGN KEY (`paymentterm_id`) REFERENCES `apppaymentterm` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `appvendor_shippingterm_id_foreign` FOREIGN KEY (`shippingterm_id`) REFERENCES `appshippingterm` (`id`) ON UPDATE CASCADE,
  CONSTRAINT `appvendor_status_id_foreign` FOREIGN KEY (`status_id`) REFERENCES `msstatus` (`id`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
