rttype_id',1,'2',NULL,'2018-07-24 03:41:56','2018-07-24 03:41:56'),(125,70,'part.requires_fulfillment',1,'1',NULL,'2018-07-24 03:41:56','2018-07-24 03:41:56'),(126,71,'parttype_id',15,'8',NULL,'2018-07-24 03:42:20','2018-07-24 03:42:20'),(127,72,'\n            SELECT cfgsalesorderline.id\n            FROM cfgsalesorderline\n            INNER JOIN appsetting ON appsetting.id = 100 AND appsetting.value = 1\n            INNER JOIN cfgtransactionline ON cfgsalesorderline.id = cfgtransactionline.id AND cfgtransactionline.transaction_id = :id\n            INNER JOIN appsalesorder ON cfgtransactionline.transaction_id = appsalesorder.id AND appsalesorder.estimate_tax = 1\n            INNER JOIN appsite ON cfgsalesorderline.site_id = appsite.id\n            LEFT JOIN appcarrier ON appsalesorder.carrier_id = appcarrier.id AND appcarrier.name = \"Will Call\"\n            LEFT JOIN apppart ON apppart.id = cfgsalesorderline.part_id\n            LEFT JOIN appvendor ON appvendor.id = IFNULL(apppart.dropship_vendor_id, apppart.default_vendor_id)\n            LEFT JOIN cfgaccountaddress ON appvendor.default_address_id = cfgaccountaddress.id\n            INNER JOIN appaddress ON appaddress.id = IF(cfgsalesorderline.linetype_id = 4 AND cfgaccountaddress.address_id IS NOT NULL, cfgaccountaddress.address_id, appsite.address_id)\n            WHERE cfgsalesorderline.deleted_at IS NULL AND (appaddress.is_valid = 2 OR appaddress.address_1 IS NULL OR appaddress.city IS NULL OR appaddress.countrydivision_id IS NULL OR appaddress.country_id IS NULL OR appaddress.postal_code IS NULL) AND (appcarrier.id IS NULL OR cfgsalesorderline.linetype_id = 4)\n            UNION ALL\n            SELECT appsalesorder.id\n            FROM appsalesorder\n            INNER JOIN appsetting ON appsetting.id = 100 AND appsetting.value = 1\n            INNER JOIN appaddress ON appsalesorder.shipaddress_id = appaddress.id\n            LEFT JOIN appcustomer ON appsalesorder.customer_id = appcustomer.id\n            LEFT JOIN appcarrier ON appsalesorder.carrier_id = appcarrier.id AND appcarrier.name = \"Will Call\"\n            WHERE appsalesorder.id = :id AND appcustomer.id IS NULL AND appsalesorder.estimate_tax = 1 AND (appaddress.is_valid = 2 OR (appaddress.address_1 IS NULL OR appaddress.city IS NULL OR appaddress.countrydivision_id IS NULL OR appaddress.country_id IS NULL OR appaddress.postal_code IS NULL)) AND appcarrier.id IS NULL',18,NULL,NULL,'2018-07-24 03:53:10','2018-07-24 03:53:10'),(128,73,'\n            SELECT cfgquoteline.id\n            FROM cfgquoteline\n            INNER JOIN appsetting ON appsetting.id = 100 AND appsetting.value = 1\n            INNER JOIN cfgtransactionline ON cfgquoteline.id = cfgtransactionline.id AND cfgtransactionline.transaction_id = :id\n            INNER JOIN appquote ON cfgtransactionline.transaction_id = appquote.id AND appquote.estimate_tax = 1\n            INNER JOIN appsite ON cfgquoteline.site_id = appsite.id\n            LEFT JOIN appcarrier ON appquote.carrier_id = appcarrier.id AND appcarrier.name = \"Will Call\"\n            LEFT JOIN apppart ON apppart.id = cfgquoteline.part_id\n            LEFT JOIN appvendor ON appvendor.id = IFNULL(apppart.dropship_vendor_id, apppart.default_vendor_id)\n            LEFT JOIN cfgaccountaddress ON appvendor.default_address_id = cfgaccountaddress.id\n            INNER JOIN appaddress ON appaddress.id = IF(cfgquoteline.linetype_id = 4 AND cfgaccountaddress.address_id IS NOT NULL, cfgaccountaddress.address_id, appsite.address_id)\n            WHERE cfgquoteline.deleted_at IS NULL AND (appaddress.is_valid = 2 OR (appaddress.address_1 IS NULL OR appaddress.city IS NULL OR appaddress.countrydivision_id IS NULL OR appaddress.country_id IS NULL OR appaddress.postal_code IS NULL)) AND (appcarrier.id IS NULL OR (appcarrier.id IS NOT NULL AND cfgquoteline.linetype_id = 4))\n            UNION ALL\n            SELECT appquote.id\n            FROM appquote\n            INNER JOIN appsetting ON appsetting.id = 100 AND appsetting.value = 1\n            INNER JOIN appaddress ON appquote.shipaddress_id = appaddress.id\n            LEFT JOIN appcustomer ON appquote.customer_id = appcustomer.id\n            LEFT JOIN appcarrier ON appquote.carrier_id = appcarrier.id AND appcarrier.name = \"Will Call\"\n            WHERE appquote.id = :id AND appcustomer.id IS NULL AND appquote.estimate_tax = 1 AND (appaddress.is_valid = 2 OR (appaddress.address_1 IS NULL OR appaddress.city IS NULL OR appaddress.countrydivision_id IS NULL OR appaddress.country_id IS NULL OR appaddress.postal_code IS NULL)) AND appcarrier.id IS NULL',18,NULL,NULL,'2018-07-24 03:53:10','2018-07-24 03:53:10'),(129,74,'\n            SELECT apppurchaseorder.id\n            FROM apppurchaseorder\n            INNER JOIN appsetting ON appsetting.id = 100 AND appsetting.value = 1 AND apppurchaseorder.estimate_tax = 1 AND apppurchaseorder.id = :id\n            LEFT JOIN appsite ON apppurchaseorder.shipsite_id = appsite.id\n            LEFT JOIN appaddress AS remit_address ON remit_address.id = apppurchaseorder.remitaddress_id\n            LEFT JOIN appaddress AS ship_address ON ship_address.id = IFNULL(appsite.address_id, apppurchaseorder.shipaddress_id)\n            WHERE (remit_address.is_valid = 2\n                OR remit_address.address_1 IS NULL\n                OR remit_address.city IS NULL\n                OR remit_address.countrydivision_id IS NULL\n                OR remit_address.country_id IS NULL\n                OR remit_address.postal_code IS NULL\n                OR ship_address.is_valid = 2\n                OR ship_address.address_1 IS NULL\n                OR ship_address.city IS NULL\n                OR ship_address.countrydivision_id IS NULL\n                OR ship_address.country_id IS NULL\n                OR ship_address.postal_code IS NULL)',18,NULL,NULL,'2018-07-24 03:53:10','2018-07-24 03:53:10'),(130,75,'\n            SELECT appreturnorder.id\n            FROM appreturnorder\n            INNER JOIN appsetting ON appsetting.id = 100 AND appsetting.value = 1 AND appreturnorder.estimate_tax = 1 AND appreturnorder.id = :id\n            INNER JOIN cfgtransactionline ON cfgtransactionline.transaction_id = appreturnorder.id\n            INNER JOIN cfgreturnorderline ON cfgtransactionline.id = cfgreturnorderline.id AND cfgreturnorderline.linetype_id = 15\n            INNER JOIN appsite ON cfgreturnorderline.site_id = appsite.id\n            INNER JOIN appaddress AS site_address ON site_address.id = appsite.address_id\n            LEFT JOIN appaddress AS ship_address ON ship_address.id = appreturnorder.shipaddress_id\n            LEFT JOIN appcarrier ON appreturnorder.carrier_id = appcarrier.id AND appcarrier.name = \"Will Call\"\n            WHERE cfgreturnorderline.deleted_at IS NULL\n                AND (site_address.is_valid = 2\n                    OR site_address.address_1 IS NULL\n                    OR site_address.city IS NULL\n                    OR site_address.countrydivision_id IS NULL\n                    OR site_address.country_id IS NULL\n                    OR site_address.postal_code IS NULL\n                    OR ship_address.is_valid = 2\n                    OR ship_address.address_1 IS NULL\n                    OR ship_address.city IS NULL\n                    OR ship_address.countrydivision_id IS NULL\n                    OR ship_address.country_id IS NULL\n                    OR ship_address.postal_code IS NULL)\n                AND appcarrier.id IS NULL',18,NULL,NULL,'2018-07-24 03:53:10','2018-07-24 03:53:10'),(131,76,'part.id',22,'4',NULL,'2018-08-21 06:31:43','2018-08-21 06:31:43'),(132,77,'part.id',22,'4','friends pricing rule?','2018-08-22 00:51:25','2018-08-22 00:51:25'),(133,77,'part.id',14,'1','part number?','2018-08-22 00:52:51','2018-08-22 00:52:51'),(134,77,'part.id',22,'3',NULL,'2018-08-22 00:53:45','2018-08-22 00:53:45'),(135,77,'part.id',14,'3','hmm','2018-08-22 00:54:16','2018-08-22 00:54:16'),(136,77,'order.customer