INSERT INTO `mspermission` VALUES (1,'Issue Sales Order','Grants the holder the ability to issue sales orders.',NULL),(2,'Issue Purchase Order','Grants the holder the ability to issue purchase orders.',NULL),(3,'Issue Transfer Order','Grants the holder the ability to issue transfer orders.',NULL),(4,'Accept Bid Request','Grants the holder the ability to accept bid requests.',NULL),(5,'View Ledger','Grants the holder the ability to view accounting ledger data.',NULL),(6,'Receive Greater Quantity','Grants the holder the ability to receive a greater quantity than was expected on a receipt.',NULL),(7,'Auto-Link User to All Sites','Links the grantee to all sites, including new sites, automatically.',NULL),(8,'Change Customer Status','Grants the holder the ability to change the status of a customer, certain statuses can prevent sales from going through.',NULL),(9,'Issue Use Order','Grants the holder the ability to issue use orders.',NULL),(10,'Add Inventory','Grants the holder the ability to add inventory.',NULL),(11,'Adjust Inventory','Grants the holder the ability to adjust inventory.',NULL),(12,'Scrap Inventory','Grants the holder the ability to scrap inventory.',NULL),(13,'Manage \"Restricted\" Location Type Functions','Grants the holder the ability to select which users and groups can move inventory in and out of \"Restricted\" location types.',NULL),(14,'Manage \"Custom\" Location Type Functions','Grants the holder the ability to select which users and groups can move inventory in and out of \"Custom\" location types.',NULL),(15,'Manage ACL Settings','Grants the holder the ability to modify settings that change how ACLs function.',NULL),(16,'Issue Return Order','Grants the holder the ability to issue return orders.',NULL),(17,'Manage Chart of Account Balance Adjustments','Grants the holder the ability to view, create, update, and delete chart of account balance adjustments in Locate. These adjustments are not sync\'d with your accounting software, but are used to get Locate in sync with it.',NULL),(18,'Logout Users','Grants the holder the ability to log out other users.',NULL),(19,'View Margins','Grants the holder the ability to view live margin estimates in the quote and sales order modules.',NULL),(20,'Import CSV Data by ID','Grants the holder the ability to import data from CSV files by ID in addition to number.',NULL),(21,'Manage Customer/SO Invoice Settings','Grants the holder the ability to change customer and sales order invoice settings (pre-payment and invoice types).',NULL),(22,'Issue Work Order','Grants the holder the ability to issue work orders.',NULL),(23,'Override Customer Credit Limit','Grants the holder the ability to override credit limit enforcement on SOs.',NULL),(24,'Override Vendor Credit Limit','Grants the holder the ability to override credit limit enforcement on POs.',NULL),(25,'Edit Part Number','Allows the holder to modify part numbers on existing parts.',NULL),(26,'Issue Invoice','Grants the holder the ability to issue invoices manually.',NULL),(27,'Manage User Group Members','Allows the holder to add/remove users from groups.',NULL),(28,'Issue Unfulfillable Sales Orders','This permission is required when the \"Require Permission to Issue Unfulfillable Sales Orders\" setting is enabled to issue a sales order that is short on inventory.',NULL),(29,'View All Picks','Allows access to all picks when the \"Restrict Viewing of Picks to Assigned Users\" setting is enabled.',NULL),(30,'Can Choose Not to Receive Returns','Allows a user to choose not to receive a return item.',NULL),(31,'Override Address Validation Requirement','Grants the holder the ability to override address validation requirements on orders.',NULL),(32,'Can Void','Grants the holder permission to void transactions they are allowed to update/modify.',NULL),(33,'Can Give Customer Credit','Grants the holder permission to give customer credit.',NULL),(34,'Can Correct Tracking','Grants the holder the ability to modify tracking values of uncommitted inventory.',NULL),(35,'Can Substitute Parts','Grants the holder the ability to substitute parts on issued order lines that have not had work performed on them.',NULL);
/*!40000 ALTER TABLE `mspermission` ENABLE KEYS */;
UNLOCK TABLES;

